function Outcome(props) {

	let playerAttack;
	let computerAttack;

	function convertAttackToString(attackNum){
	switch(attackNum) {
		case 0:
			return 'Rock';
			break;
		case 1:
			return 'Paper';
			break;
		case 2:
			return 'Scissors';
			break;
		default:
		return 'Error';
		}

	}

	return (
		<div> Match Outcome: {props.outcome}
		</div>
		);
}

export default Outcome;
